import React from 'react'
import footer_logo from '../Assets/logo.png'

const Footer = () => {
  return (
    <div className='footer'>
        <div className="footer-logo">
            <img src={footer_logo} alt="" />
            <p>含情目(EMOKA)</p>
        </div>
    </div>
  )
}

export default Footer
